export default function Settings() {
    return (
        <div>
            <h1>Test</h1>
            <div id="settings-window" className="settings-window">
                <div className="settings-content">
                    <span className="close-settings">&times;</span>
                    <h2>Settings</h2>
                </div>
            </div>
        </div>
    )
}


